column8:
　2003年に学童の通学履き用として、また運動会の競技でも威力が発揮できるシューズとして発売された『瞬足』とSMOOTHYのコラボシューズです。<BR><BR> 通常の『瞬足』よりもファッション性の高いデザイン、<BR>カラーにしたことで運動靴というイメージを感じさせない仕上がりにしました。<BR>SMOOTHYらしいオリジナルカラーの配色で足元のオシャレを演出してくれます。<BR>足元からオシャレを楽しんで欲しいと思うデザイナーこだわりの配色です。<BR>更に、踵に入れた駿足マークはその雰囲気を損なわないように刺繍で施しました。<BR>クッション性のあるEVAソールを採用し、歩行時のお子さまの足をしっかりとサポートしてくれます。<BR>また、駿足独自の左右非対称ソールでグリップ性も高く運動靴としての機能も持ち合わせています。<BR>インソールは取り外しができ洗濯ができるので清潔に保つことができます。<BR>また、メッシュと合皮素材のアッパーですので本体も洗うことができます。<BR>靴ひもは、ゴムひもで脱ぎ穿きが簡単にでき、ベロクロを使い足首にフィット感を調整することができます。<BR>ベロ部分にはパフを入れていますので、柔らかく足首にフィットしてくれます。<BR>誰もが知っている『瞬足』でオシャレに友達と差を付けるならこのモデルです。<BR>ファッション性の高さから注目されるのは間違いなし？！シンプルなコーディネイトにさりげなく合わせたオシャレ上級者スタイルに。<BR>このモデルは、『タテノチカラ』シリーズのソールを使用しています。 <BR><style type="text/css">
